                    <TodoItems 
                        entries={this.props.entries}
                        deleteItem={this.props.deleteItem}/>
                    <button onClick={this.showTodoList} className="listcontainer-addbutton">+</button>
                </div>
            )
        }
    }
}

export default ListContainer;
